$( document ).ready(function() {
	$('.nav-button.nav-open').click(function() {
	  if ( $('.cp-nav .primary').is( ":hidden" ) ) {
	    $('.cp-nav .primary').stop().slideToggle();
	  } else {
	    $('.cp-nav .primary').stop().slideToggle();
	  }
	});

    if (window.innerWidth < 768) {
		$('.green .title').click(function(e) {
			e.preventDefault();
			$("ul .sub").toggle();
		});
	}
	$("a[href$='"+window.location.pathname+"']").parent().addClass('active');
	  if($("a[href$='"+window.location.pathname+"']").parent().parent().parent().parent().is( "ul" )){
	    $("a[href$='"+window.location.pathname+"']").parent().parent().parent().addClass('active');
	  }

	$('li.search').click(
	    function(){
	    	if($('li.search').hasClass( "opened" )){
	            $('.search-sub').toggle();
	            $('li.search').addClass('closed');
	            $('li.search').removeClass('opened');
	            $('li.search img').attr('src','/asset-library/PublishingImages/cerebral-palsy/search.jpg');
	        }
	        else{
		        $('.search-sub').toggle();
		        $('li.search').addClass('opened');
		        $('li.search').removeClass('closed');
		        $('li.search img').attr('src','/asset-library/PublishingImages/cerebral-palsy/close.jpg');
	         }
	    }
	);


	$('.search-input input').change(function(){
		$('.search-input .search').first().val($('.search-sub input').val());
	});
	new WOW().init();
});

