// setting hcp cookies
$(document).ready(function () {
    function nhs_writeCookiePlusOneYear(name, value, path) {
    // Build the expiration date string:
    var expiration_date = new Date();
    expiration_date.setFullYear(expiration_date.getFullYear() + 1);
    expiration_date = expiration_date.toGMTString();

    // Build the set-cookie string:
    var cookie_string = escape(name) + "=" + escape(value) + "; expires=" + expiration_date;
    if (path != null)
        cookie_string += "; path=" + path;

    // Create/update the cookie:
    document.cookie = cookie_string;
    }

    $("._hcp-link").click(function(){
        nhs_writeCookiePlusOneYear("isHCP", "1", "/");
    })

    $("._patient-link").click(function(){
        nhs_writeCookiePlusOneYear("isHCP", "0", "/");
    })
});

function NHSCheckAudienceRedirection() {
    var _cookieHCP = parseInt(nhs_getCookie("isHCP"));
    //console.log($('.AudienceToggle input[name=redirection]').val());

    var __ok = true;
    if ($(".place-for-hcp-switch").length && false) {
        if (_cookieHCP != 1) {
            _cookieHCP = 0;
            nhs_writeCookiePlusOneYear("isHCP", "0", "/");
        }
    } else {

        if (_cookieHCP !== 0 && _cookieHCP != 1) {
            __ok = false;
            $(window).load(function () {
                OpenHcpPatientPopIn();

            });



        }
    }
    if (__ok){
        var str = $('.AudienceToggle input[name=audience]').val();
        var _audiences = str.split(",");

        var _redirect = true;
        for (_val in _audiences) {
            if (_audiences[_val] == "" || (_audiences[_val] == "hcp" && _cookieHCP == 1) || (_audiences[_val] == "patient" && _cookieHCP == 0)) {
                _redirect = false;
            }
        }
        if (_redirect) {


            var _content = '<div class="AudienceToggleRedirectionBox">';
            if (_cookieHCP == 1) {
                _content += $("#Patient_Redirection_message").html();
            } else {
                _content += $("#HCP_Redirection_message").html();
            }
            _content += '</div>';
            setTimeout(function () { $.fancybox.open([{ content: _content, type: 'inline' }], { wrapCSS: 'nhs-fancybox', padding: 0, margin: 0, scrolling: 'no', closeBtn: false, modal: true, minHeight: 80 }); }, 0);
            //$.fancybox.open([{ content: _content, type: 'inline' }], { wrapCSS: 'nhs-fancybox', padding: 0, margin: 0, scrolling: 'no', closeBtn: false, modal: true, minHeight: 80 });

            var _redirection = $('.AudienceToggle input[name=redirection]').val();
            var _suffix = $('.AudienceToggle input[name=suffix]').val();

            if (!_redirection) {


                _redirection = document.location.href;
                _redirection = _redirection.replace(_suffix, '');

                _redirection = _redirection.split("?")[0].split("#")[0];

                if (_audiences[_val] == "patient") {
                    var _pos = _redirection.indexOf(".aspx");
                    if (_pos === -1) {
                        _redirection += _suffix;
                    } else {
                        _redirection = _redirection.substring(0, _pos) + _suffix + _redirection.substring(_pos, _redirection.length);
                    }

                }


            }

           setTimeout(function () { document.location.href = _redirection; }, 2500);

        } else {
            $.fancybox.close();
        }

    }
}
